import React, { useEffect, useState } from "react";
import { ShoppingCart, Plus, TrendingUp } from "lucide-react";
import "./styles.css";

export default function ProductList() {
  const [products, setProducts] = useState([
    {
      id: 1,
      name: "Wireless Headphones",
      price: 2999,
      image: "./images/headphones.jpg",
      tag: "Trending"
    },
    {
      id: 2,
      name: "Smart Watch",
      price: 4499,
      image: "https://images.unsplash.com/photo-1523275335684-37898b6baf30?w=400&h=400&fit=crop",
      tag: "New"
    },
    {
      id: 3,
      name: "Laptop Backpack",
      price: 1299,
      image: "https://images.unsplash.com/photo-1553062407-98eeb64c6a62?w=400&h=400&fit=crop"
    },
    {
      id: 4,
      name: "USB-C Cable",
      price: 399,
      image: "https://images.unsplash.com/photo-1583863788434-e58a36330cf0?w=400&h=400&fit=crop"
    },
    {
      id: 5,
      name: "Phone Stand",
      price: 699,
      image: "https://images.unsplash.com/photo-1600087626014-e652e18bbff2?w=400&h=400&fit=crop",
      tag: "Sale"
    },
    {
      id: 6,
      name: "Bluetooth Speaker",
      price: 1899,
      image: "https://images.unsplash.com/photo-1608043152269-423dbba4e7e1?w=400&h=400&fit=crop"
    }
  ]);
  const [cartCount, setCartCount] = useState(0);

  // Simulate API call
  useEffect(() => {
    // API.get("/products")
    //   .then((res) => setProducts(res.data))
    //   .catch((err) => console.error(err));
  }, []);

  const addToCart = async (productId) => {
    // await API.post("/cart", { productId, qty: 1 });
    setCartCount(prev => prev + 1);

    // Show toast notification
    const toast = document.createElement('div');
    toast.className = 'toast-notification';
    toast.textContent = 'âœ“ Added to cart!';
    document.body.appendChild(toast);

    setTimeout(() => {
      toast.classList.add('show');
    }, 10);

    setTimeout(() => {
      toast.classList.remove('show');
      setTimeout(() => toast.remove(), 300);
    }, 2000);
  };

  const goToCart = () => {
    // navigate("/cart");
    alert('Navigate to cart page');
  };

  return (
    <div className="page-wrapper">
      {/* Header */}
      <header className="header">
        <div className="header-container">
          <div className="header-content">
            <div className="brand-section">
              <div className="brand-icon">
                <TrendingUp className="icon" />
              </div>
              <div className="brand-text">
                <h1 className="brand-title">Vibe Commerce</h1>
                <p className="brand-subtitle">Shop the latest trends</p>
              </div>
            </div>

            <button onClick={goToCart} className="cart-button">
              <ShoppingCart className="cart-icon" />
              <span>Cart</span>
              {cartCount > 0 && (
                <span className="cart-badge">{cartCount}</span>
              )}
            </button>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="main-content">
        {/* Hero Section */}
        <div className="hero-section">
          <h2 className="hero-title">Discover Amazing Products</h2>
          <p className="hero-subtitle">Curated collection of trending items just for you</p>
        </div>

        {/* Product Grid */}
        <div className="product-grid">
          {products.map((product, index) => (
            <div
              key={product.id}
              className="product-card"
              style={{ animationDelay: `${index * 0.1}s` }}
            >
              {/* Product Image */}
              <div className="product-image-wrapper">
                <img
                  src={product.image}
                  alt={product.name}
                  className="product-image"
                />
                {product.tag && (
                  <span className={`product-tag tag-${product.tag.toLowerCase()}`}>
                    {product.tag}
                  </span>
                )}
              </div>

              {/* Product Details */}
              <div className="product-details">
                <h3 className="product-name">{product.name}</h3>
                <div className="product-info">
                  <p className="product-price">â‚¹{product.price.toLocaleString()}</p>
                  <span className="product-delivery">Free Delivery</span>
                </div>

                {/* Add to Cart Button */}
                <button
                  onClick={() => addToCart(product.id)}
                  className="add-to-cart-btn"
                >
                  <Plus className="plus-icon" />
                  <span>Add to Cart</span>
                </button>
              </div>
            </div>
          ))}
        </div>
      </main>

      {/* Footer */}
      <footer className="footer">
        <div className="footer-content">
          <p>Â© 2025 Vibe Commerce. Bringing you the best shopping experience.</p>
        </div>
      </footer>
    </div>
  );
}
